import React, {Component} from 'react';
import {Carousel} from 'react-responsive-carousel';
import HEADER1 from './header2.jpg'
import HEADER2 from  './header3.jpg'
import "react-responsive-carousel/lib/styles/carousel.min.css";
import './carousel.style.css';
class HeaderCarousel extends Component {
    render () {
        return(
            <Carousel showArrows={true} showThumbs={false} infiniteLoop autoPlay interval={6000}>
                <div className='img-wrapper'>
                    <img src={HEADER1} alt='header1' className='header-carousel-img'/>
                </div>
                <div className='img-wrapper'>
                    <img src={HEADER2} alt='header2' className='header-carousel-img'/>
                </div>

            </Carousel>
        );
    }
}

export default HeaderCarousel;
